import React from 'react';
import CategoryCard from "./CategoryCard";

const category_list = [ {id: 1, name:'Technology'}, {id: 2, name: 'Self Improvement'},
    {id: 3, name:  'Writing'},{ id: 4, name: 'Relationship'}, { id: 5, name: 'Machine Learning'}, { id: 6, name: 'Productivity'}, ]

export interface Category {
    id: number,
    name: string,
}



const CategoryList = (category_list: Category[]) => {
    return (
        <>
            <div className='flex flex-wrap gap-4'>
                {category_list.map((category: any) => <CategoryCard name={category.name}/>)}
            </div>
        </>
    )
}

export default CategoryList;
